CREATE DEFINER=`root`@`localhost` PROCEDURE `copyEncountersToIvr`()
BEGIN

DECLARE max_enc_id_in_ivr INT;

   select ifnull(max(ENC_ID),0) INTO max_enc_id_in_ivr from openmrs_ivr.encounters;
   
   Insert INTO  openmrs_ivr.encounters
(`ENC_ID`,
`PATIENT_ID`,
`ENC_TYPE`,
`ENC_DATE`,
`CONTACT_NUM`,
`SMOKER_CALC`,
`TARGET_SBP`,
`MED_BP`,
`TT_ADHER`,
`HIGH_RISK_CALC`,
`REF_DOC`,
`USER_NAME`,
`USER_ROLE`) 
(SELECT 
    *
FROM
    (SELECT 
        cn.enc_id as ENC_ID,
            max(if(cn.concept_name = 'PATIENT_ID', cn.Value, NULL)) as 'PATIENT_ID',
            max(if(cn.concept_name = 'ENC_TYPE', cn.Value, NULL)) as 'ENC_TYPE',
            max(if(cn.concept_name = 'ENC_DATE', cn.Value, NULL)) as 'ENC_DATE',
            max(if(cn.concept_name = 'CONTACT_NUM', cn.Value, NULL)) as 'CONTACT_NUM',
            max(if(cn.concept_name = 'SMOKER_CALC', cn.Value, NULL)) as 'SMOKER_CALC',
            max(if(cn.concept_name = 'TARGET_SBP', cn.Value, NULL)) as 'TARGET_SBP',
            max(if(cn.concept_name = 'MED_BP', cn.Value, NULL)) as 'MED_BP',
            max(if(cn.concept_name = 'TT_ADHER', cn.Value, NULL)) as 'TT_ADHER',
            max(if(cn.concept_name = 'HIGH_RISK_CALC', cn.Value, NULL)) as 'HIGH_RISK_CALC',
            max(if(cn.concept_name = 'REF_DOC', cn.Value, NULL)) as 'REF_DOC',
            max(if(cn.concept_name = 'CURRENT_USER_LOGIN', cn.Value, NULL)) as 'USER_NAME',
            max(if(cn.concept_name = 'CURRENT_USER_ROLE', cn.Value, NULL)) as 'USER_ROLE'
    from
        (Select 
        cnn.concept_id,
            cnn.name as concept_name,
            o.encounter_id as enc_id,
            ifnull(o.value_text, 'NA') Value
    from
        openmrs.concept_name cnn
    join openmrs.obs o ON cnn.concept_id = o.concept_id
    where
        cnn.locale = 'en' and cnn.voided = '0'
    order by cnn.concept_id) cn
    group by cn.enc_id) obb
where
    obb.ENC_ID > max_enc_id_in_ivr );



END ;;
